import React from 'react';
import Navbar from './../navbar/navbar';
import { Name, MenuBar, HalfSection, AboutBody,MenuBarBackground } from './../About/style';
import linkedIn from './../../images/linkedIn.jpg';
import email from './../../images/email.jpg';

export default function Home() {
    return (
        <AboutBody>
            <MenuBarBackground>
            <MenuBar>
                <Name>Daniel</Name>
                <Navbar />
            </MenuBar>
            </MenuBarBackground>
            <HalfSection>
                <div>
                    <h1 style={{color: '#ff2a00'}}> Contact Me!</h1>
                </div>
            </HalfSection>
            <HalfSection>
                <img src={linkedIn} />
            </HalfSection>
            <HalfSection>
                <div>
                    <h1 style={{color: '#ff2a00'}}> Contact Me!</h1>
                </div>
            </HalfSection>
        </AboutBody>
        )
}
